import React from "react";
import PopulateCars from "./PopulateCars";
import { useState, useEffect} from "react";
import Api from "../../api";


export default () => {

  let [cars, setCars] = useState([]);
  console.log(cars);
  let fetchCars = async () => {
    let api = new Api();
    let allCars = await api.getAllCars();
    setCars(allCars);
  }
  useEffect(() => {
    fetchCars();
  }, []);
  return (
    <section id="cars_section" className="bg-cyan-50  min-h-screen"  >
      <div class="container max-w-6xl mx-auto my-32 px-6 text-gray-900 pt-5 md:px-0">
        <div class="flex justify-around mb-20">
          <h2 class="text-4xl text-center font-alata uppercase md:text-left md:text-5xl">
            CARS
          </h2>

          <input
            type="text"
            class="border-2 w-60 text-center rounded-lg placeholder-purple-500 focus:outline-none"
            placeholder="Search for a car here"
            id="search-input"
          />
        </div>
      </div>

      <div className="flex flex-column w-full md:grid md:grid-cols-3">
        <PopulateCars></PopulateCars>
      </div>
    </section>
  );
};
